import React from "react";
import { Link } from "react-router-dom";

const Nav = () => {
  return (

    <div className="navbar">
        <div className="navbar-container container">
            <div></div>
            <ul class="menu-items">
                <li><Link to="#">Home</Link></li>
                <li><Link href="#">Contact</Link></li>
            </ul>
        </div>
    </div>
  );
};

export default Nav;
